import { PageMain } from "core";
import React, { Component } from "react";
import NotificationSystem from "react-notification-system";

export default class BaseDataPage extends Component {
    constructor(props) {
        super(props);

        this.state = {
            isLoading: false
        };

        this.notificationSystem = React.createRef();


    }

    render() {
        return (
            <>
                <PageMain context={ this } title="اطلاعات پایه" icon="database-search" isLoading={ this.state.isLoading }
                    footerLinks={[{ href: "/", text: "صفحه اصلی" }]}>

                    <h1>Test Part</h1>

                </PageMain>
                <NotificationSystem ref={ this.notificationSystem } />
            </>
        )
    }
}
